import React from 'react';

function NavItem(){
    return (
        <li class="nav-item">
            <a class="nav-link collapsed" href="/">
                <i class="fas fa-fw fa-folder"></i>
                <span>Pages</span>
            </a>
        </li>
    );
};

export default NavItem;
